        "Name": "戸惑い",
        "Desc": "弱点撃破状態になった時、「戸惑い」1層につき、付与された全持続ダメージ系デバフが、本来のダメージ 30.0% 分のダメージを発生する。その後、この状態が1層消費される。最大で5層累積できる。"
