        "Name": "珠露",
        "Desc": "特定の「豊穣」の運命の祝福が作り出すチャージ効果。<br>チャージ値はキャラの最大HPの 500.0% を超えない。攻撃を行った後に破裂し、チャージ値に応じて、攻撃した敵に付加ダメージを与える。"
